import httpClient from "@/utils/httpclient";
export default {
  name: "testPoint",
  data: function data() {
    return {
      currentPage: 1,
      pageSize: 10,
      total: 0,
      data: null,
      table: null,
      pageCount: 0,
      tableFields: {
        point: {
          label: this.$t('m.cloud.test_store_name'),
          class: "text-center"
        },
        addressInfo: {
          label: this.$t('m.add_shop.label_address'),
          class: "text-center"
        },
        userInfo: {
          label: this.$t('m.common.contact_info'),
          class: "text-center"
        },
        tenantName: {
          label: this.$t('m.common.dealership'),
          class: "text-center"
        },
        action: {
          label: this.$t('m.common.action'),
          class: 'text-center'
        }
      }
    };
  },
  mounted: function mounted() {
    this.initData();
  },
  methods: {
    initData: function initData() {
      var _this = this;

      httpClient.get("/api/v1/clouddrive/parkinglot/pagelist").then(function (res) {
        if (res.data.code == 200) {
          _this.total = res.data.data.rowCount;
          _this.data = res.data.data;
          _this.pageCount = res.data.data.totalPages;

          _this.filterData(res.data.data.datas);
        }
      });
    },
    filterData: function filterData(data) {
      this.table = data.map(function (item) {
        return {
          point: item.parkingName,
          address: item.address,
          desc: item.parkingAddressDesc,
          user: item.parkingContactName,
          phone: item.parkingContactPhone,
          tenantName: item.tenantName,
          id: item.id
        };
      });
    },
    changePage: function changePage(page) {
      this.initData(page);
    }
  }
};
